.eqv BASE_ADDRESS 0x10008000
.eqv MAX_ADDRESS 0x10018000

# Colors
.eqv HEAD 0x0ff00
.eqv LEGS 0x964B00

# Colors used in the background / layout
.eqv BACKGROUND_BLUE 0x81F5F7
.eqv STAIRS 0xB4B4B4
.eqv COINS 0xFFF200
.eqv SPIKES 0xED1C24
.eqv PLATFORM 0xB5A5D5
.eqv KEY 0xFFA3B1
.eqv LAVA 0xFF7E00
.eqv LABEL 0xFFFFFF
.eqv HEADER 0x000000

.text


main:
	li $s0, BASE_ADDRESS 
	li $s1, MAX_ADDRESS
	move $s4, $zero 		# $s4 is the Number of coins
	
	jal level_1_set			# Create the background
	jal character			# Create the character
	
	j input_checker

level_1_set:
	la $t0, 0($s0)			# set $t0 to the BASE_ADDRESS
	la $t1, level_1			# set $t1 to level_1
	start_level_1_loop:
	bge $t0, $s1, end_start_level_1
	lw $t2, 0($t1)
	sw $t2, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j start_level_1_loop
	end_start_level_1:
	jr $ra
    
input_checker:
	li $s7, 0xffff0000
    	lw $s6, 0($s7)
    	beq $s6, 1, input_detected      # if any input, go to the input function
    	j input_checker             	# else go keep checking for any input

input_detected:
	lw $t9, 4($s7)
    	beq $t9, 0x61, left_motion	# if input is 'a', move left
    	beq $t9, 0x77, climb_up		# if input is 'w', move up
    	beq $t9, 0x73, climb_down	# if input is 's', move down
    	beq $t9, 0x64, right_motion	# if input is 'd', move right
    	beq $t9, 0x70, main		# if input is 'p', restart the game

	j input_checker
	
right_motion:
	la $t0, 5420($s0)
	
	lw $t7, 6192($s0)
	beq $t7, SPIKES, exit
	
	lw $t8, 5936($s0)
	beq $t8, KEY, update_header_key
	
	lw $t7, 6448($s0)
	beq $t7, BACKGROUND_BLUE, input_checker
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	beq $t8, COINS, unset_coins_right
	
	addi $s0, $s0, 4
	
	jal character
	
	j input_checker

unset_coins_right:
	la $t8, 5936($s0)
	li $s5, BACKGROUND_BLUE
	
	sw $s5, 0($t8)
	sw $s5, 4($t8)
	sw $s5, 8($t8)
	sw $s5, 12($t8)
	sw $s5, -256($t8)
	sw $s5, -252($t8)
	sw $s5, -248($t8)
	sw $s5, -244($t8)
	sw $s5, -504($t8)
	sw $s5, -508($t8)
	sw $s5, 260($t8)
	sw $s5, 264($t8)

	addi $s0, $s0, 4
	addi $s4, $s4, 1
	
	jal character

	jal update_header_coins
	
	j input_checker

left_motion:
	la $t0, 5420($s0)
	
	lw $t7, 6184($s0)
	beq $t7, SPIKES, exit
	
	lw $t8, 5928($s0)
	beq $t8, KEY, update_header_key
	
	lw $t7, 6440($s0)
	beq $t7, BACKGROUND_BLUE, input_checker
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	beq $t8, COINS, unset_coins_left
	
	addi $s0, $s0, -4
	
	jal character
	
	j input_checker

unset_coins_left:

	addi $s4, $s4, 1
	
	la $t8, 5928($s0)
	li $s5, BACKGROUND_BLUE
	
	sw $s5, 0($t8)
	sw $s5, -4($t8)
	sw $s5, -8($t8)
	sw $s5, -12($t8)
	sw $s5, -256($t8)
	sw $s5, -260($t8)
	sw $s5, -264($t8)
	sw $s5, -268($t8)
	sw $s5, -516($t8)
	sw $s5, -520($t8)
	sw $s5, 252($t8)
	sw $s5, 248($t8)

	addi $s0, $s0, -4
	
	jal character
	
	jal update_header_coins
	
	j input_checker

climb_up:
	la $t0, 5420($s0)
	
	lw $t7, -256($t0)
	bne $t7, STAIRS, input_checker
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, -256
	
	jal character
	
	j input_checker
	
climb_down:
	la $t0, 5420($s0)
	
	lw $t7, 1024($t0)
	bne $t7, STAIRS, input_checker
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, 256
	
	jal character
	
	j input_checker


character:
    	la $t0, 5420($s0)
	li $t1, LEGS
	li $t2, HEAD
	
	lw $t3, 0($t0)
	lw $t4, 256($t0)
	lw $t5, 512($t0)
	lw $t6, 768($t0)
	
	
	sw $t2, 0($t0)			# Set the head green
	sw $t1, 256($t0)		# Set the legs to brown
	sw $t1, 512($t0)		# Set the legs to brown
	sw $t1, 768($t0)		# Set the legs to brown
	
	jr $ra

exit:
	li $v0, 10
    	syscall
    	
reset:
	li $s0, BASE_ADDRESS 
	li $s1, MAX_ADDRESS
	move $s4, $zero 		# $s4 is the Number of coins
	move $t0, $zero
	la $t1, level_1
	move $t2, $zero
	
	jal level_1_set			# Create the background
	jal character			# Create the character
	
	j input_checker


update_header_coins:
	beq $s4, 0, write_zero
	beq $s4, 1, write_one
	beq $s4, 2, write_two
	beq $s4, 3, write_three
	beq $s4, 4, write_four
	beq $s4, 5, write_five
	beq $s4, 6, write_six
	
	jr $ra

update_header_key:
	li $t0, BASE_ADDRESS
	li $t1, HEADER
	li $t2, KEY
	
	sw $t1, 980($t0)
	sw $t1, 984($t0)
	sw $t1, 988($t0)
	sw $t1, 992($t0)
	sw $t1, 1236($t0)
	sw $t1, 1244($t0)
	sw $t1, 1248($t0)
	sw $t2, 1496($t0)
	sw $t2, 1500($t0)
	sw $t2, 1508($t0)
	sw $t2, 1756($t0)
	sw $t1, 1760($t0)
	sw $t1, 2016($t0)

	li $s0, BASE_ADDRESS
	
	beq $s4, 0, set_0
	beq $s4, 1, set_1
	beq $s4, 2, set_2
	beq $s4, 3, set_3
	beq $s4, 4, set_4
	beq $s4, 5, set_5
	beq $s4, 6, set_6
	
write_zero:
	li $t0, BASE_ADDRESS
	li $t1, HEADER
	li $t2, LABEL
	
	# Top row
	sw $t2, 868($t0)
	sw $t2, 872($t0)
	sw $t2, 876($t0)
	sw $t2, 880($t0)
	
	# Second Row
	sw $t2, 1128($t0)
	sw $t1, 1132($t0)
	sw $t1, 1136($t0)
	sw $t2, 1140($t0)
	
	# Third Row
	sw $t2, 1384($t0)
	sw $t1, 1388($t0)
	sw $t1, 1392($t0)
	sw $t2, 1396($t0)
	
